import './App.css';
import About from './pages/About';
import Home from './pages/Home';
import Projects from './pages/Projects';
import Technologies from './pages/Technologies';
import Footer from './pages/Footer';

function App() {
  return (
    <div>
      <Home />
      <About />
      <Technologies />
      <Projects />
      <Footer />
    </div>
  );
}

export default App;
